s = ''
k = 3945

def maxVowels(s, k):
    """
    :type s: str
    :type k: int
    :rtype: int
        """
    if s=='':
        return 0
            
    vowels = ['a', 'e', 'i', 'o', 'u']
    count = 0
    temp=0

    sTemp = s[:k]
    for i in sTemp:
        if i in vowels:
            temp += 1
    count = temp

    for i in range(k+1,len(s)+1):
        sTemp = s[i-k : i]
        if s[i-k-1] in vowels:
            temp -= 1
        if s[i-1] in vowels:
            temp+=1
        count = max(temp, count)

    return count

print( maxVowels(s, k) )